import "./App.css";
import Items from "./components/Items/Items";
import NavBar from "./components/Navbar/NavBar";

function App() {
   const food = [
      {
         id: 1,
         name: "Sushi",
         desc: "Finest fish and veggies",
         price: 22.99,
      },
      {
         id: 2,
         name: "Schnitzel",
         desc: "A german speciality!",
         price: 16.5,
      },
      {
         id: 3,
         name: "Barbecue Burger",
         desc: "American, raw, mealy",
         price: 12.99,
      },
      {
         id: 4,
         name: "Green Bowl",
         desc: "Healthy ..and green..",
         price: 18.99,
      },
   ];

   const setCount =(count)=>{
    console.log("In APP", count);
   }

   return (
      <div className="App">
         <NavBar />
         <Items food={food} onSelect={setCount} />
      </div>
   );
}

export default App;
